const documentationUrl = 'https://softedco.github.io/CrazyGamesDeveloperToolKit';
const versionUrl = 'https://softedco.github.io/CrazyGamesDeveloperToolKit/version';
const blockIcon = 'data:image/png;base64,';
const menuIcon = 'data:image/png;base64,';

let initialized = 'false';
let loadingState = 'stopped';
let adBreakState = 'error';
let gameplayState = 'started/resumed';
let pageScroll = 'false';
let eventListener = 'false';
let responsiveBannerContainer = 'false';
let adBanner = 'false';
let adBlock = 'false';

class CGDTK {
    getInfo() {
        return {
            id: 'CGDTK',
            color1: '#6937b9',
            color2: '#27193f',
            color3: '#27193f',
            blockIconURI: blockIcon,
            menuIconURI: menuIcon,
            docsURI: 'https://softedco.github.io/CrazyGamesDeveloperToolKit/DOCUMENTATION',
            name: 'CrazyGames Developer ToolKit',
            blocks: [
                {
                    opcode: 'initialize',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'Initialize the extension'
                },
                {
                    opcode: 'version',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'Extension`s [TYPE] version',
                    arguments: {
                        TYPE: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'versions',
                            defaultValue: 'current'
                        }
                    }
                },
                {
                    opcode: 'userInfo',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'Get info about user`s [OB] [NV]',
                    arguments: {
                        OB: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'osOrBrowser',
                            defaultValue: 'OS'
                        },
                        NV: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'nameOrVersion',
                            defaultValue: 'name'
                        }
                    }
                },
                {
                    opcode: 'countryOrDeviceUserInfo',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'Get info about user`s [CD]',
                    arguments: {
                        CD: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'countryOrDevice',
                            defaultValue: 'country code'
                        }
                    }
                },
                {
                    opcode: 'states',
                    blockType: Scratch.BlockType.REPORTER,
                    text: '[STATES] state',
                    arguments: {
                        STATES: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'states',
                            defaultValue: 'Ad break'
                        }
                    }
                },
                {
                    opcode: 'inviteLinkGenerator',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'Generate an invite link with [DATA]',
                    arguments: {
                        DATA: {
                            type: Scratch.ArgumentType.STRING,
                            defaultValue: 'data'
                        }
                    }
                },
                {
                    opcode: 'inviteLinkReciever',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'Invite link data'
                },
                {
                    opcode: 'detector',
                    blockType: Scratch.BlockType.BOOLEAN,
                    text: '[DETECTION] active?',
                    arguments: {
                        DETECTION: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'detections',
                            defaultValue: 'adblock'
                        }
                    }
                },
                {
                    opcode: 'eventListener',
                    blockType: Scratch.BlockType.COMMAND,
                    text: '[ACT] an event listener',
                    arguments: {
                        ACT: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'eventListenerActions',
                            defaultValue: 'Install'
                        }
                    }
                },
                {
                    opcode: 'loadingTrigger',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'Set loading state at [STATE]',
                    arguments: {
                        STATE: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'loadingStates',
                            defaultValue: 'started'
                        }
                    }
                },
                {
                    opcode: 'gameplayTrigger',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'Set gameplay state at [STATE]',
                    arguments: {
                        STATE: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'gameplayStates',
                            defaultValue: 'started/resumed'
                        }
                    }
                },
                {
                    opcode: 'adBreak',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'Start a [TYPE] ad break',
                    arguments: {
                        TYPE: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'adTypes',
                            defaultValue: 'rewarded'
                        }
                    }
                },
                {
                    opcode: 'adBanner',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'Add [BC] with [RES] resolution',
                    arguments: {
                        BC: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'bannerOrContainer',
                            defaultValue: 'an ad banner'
                        },
                        RES: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'resolution',
                            defaultValue: '300*250'
                        }
                    }
                },
                {
                    opcode: 'bannerRemove',
                    blockType: Scratch.BlockType.COMMAND,
                    text: 'Remove [BC]',
                    arguments: {
                        BC: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'bannerOrContainer',
                            defaultValue: 'a responsive banner container'
                        }
                    }
                },
                {
                    opcode: 'pageScroll',
                    blockType: Scratch.BlockType.COMMAND,
                    text: '[ACT] page scroll',
                    arguments: {
                        ACT: {
                            type: Scratch.ArgumentType.STRING,
                            menu: 'pageScrollActions',
                            defaultValue: 'Disable'
                        }
                    }
                }
            ],
            menus: {
                versions: {
                    items: ['current','up-to-date']
                },
                adTypes: {
                    items: ['rewarded','midgame']
                },
                eventListenerActions: {
                    items: ['Install','Remove']
                },
                pageScrollActions: {
                    items: ['Enable','Disable']
                },
                states: {
                    items: ['Ad break','Gameplay','Loading']
                },
                loadingStates: {
                    items: ['started','stopped']
                },
                gameplayStates: {
                    items: ['started/resumed','stopped/paused','celebrated']
                },
                resolution: {
                    items: ['970x90','320x50','160x600','336x280','728x90','300x600','468x60','970x250','300x250','250x250','120x600']
                },
                bannerOrContainer: {
                    items: ['an ad banner','a responsive banner container']
                },
                osOrBrowser: {
                    items: ['OS','browser']
                },
                nameOrVersion: {
                    items: ['name','version']
                },
                countryOrDevice: {
                    items: ['country code','device']
                },
                detections: {
                    items: ['adblock','ad banner','responsive banner container','event listener','page scroll']
                }
            }
        };
    }
    initialize() {
        initialized = 'true'
        return 'Work In Progress'
    }
    version(args) {
        if (args.TYPE == 'current') {
            return 'Beta 2'
        } else if (args.TYPE == 'up-to-date') {
            return fetch(versionUrl).then(response => response.text())
        } else {
            return 'Error'
        }
    }
    userInfo(args) {
        if (initialized == 'true') {
            if (args.OB == 'OS') {
                if (args.NV == 'name') {
                    return 'Work In Progress'
                } else if (args.NV == 'version') {
                    return 'Work In Progress'
                } else {
                    return 'Error'
                }
            } else if (args.OB == 'browser') {
                if (args.NV == 'name') {
                    return 'Work In Progress'
                } else if (args.NV == 'version') {
                    return 'Work In Progress'
                } else {
                    return 'Error'
                }
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    countryOrDeviceUserInfo(args) {
        if (initialized == 'true') {
            if (args.CD == 'country code') {
                return 'Work In Progress'
            } else if (args.CD == 'device') {
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    inviteLinkGenerator(args) {
        if (initialized == 'true') {
            return 'Work In Progress'
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    inviteLinkReciever() {
        if (initialized == 'true') {
            return 'Work In Progress'
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    states(args) {
        if (initialized == 'true') {
            if (args.STATES == 'Ad break') {
                if (eventListener == 'true') {
                    return adBreakState
                } else if (eventListener == 'false') {
                    return 'Error'
                } else {
                    return 'Error'
                }
            } else if (args.STATES == 'Gameplay') {
                return gameplayState
            } else if (args.STATES == 'Loading') {
                return loadingState
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    detector(args) {
        if (initialized == 'true') {
            if (args.DETECTION == 'adblock') {
                return adBlock
            } else if (args.DETECTION == 'ad banner') {
                return adBanner
            } else if (args.DETECTION == 'responsive banner container') {
                return responsiveBannerContainer
            } else if (args.DETECTION == 'event listener') {
                return eventListener
            } else if (args.DETECTION == 'page scroll') {
                return pageScroll
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            if (args.DETECTION == 'Initialization') {
                return initialized
            } else {
                return 'Error. Not initialized'
            }
        } else {
            return 'Error'
        }
    }
    eventListener(args) {
        if (initialized == 'true') {
            if (args.ACT == 'Install') {
                eventListener = 'true'
                return 'Work In Progress'
            } else if (args.ACT == 'Remove') {
                eventListener = 'false'
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    adBreak(args) {
        if (initialized == 'true') {
            if (args.TYPE == 'rewarded') {
                return 'Work In Progress'
            } else if (args.TYPE=='midgame') {
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    loadingTrigger(args) {
        if (initialized == 'true') {
            if (args.STATE == 'started') {
                loadingState = 'started'
                return 'Work In Progress'
            } else if (args.STATE == 'stopped') {
                loadingState = 'stopped'
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    gameplayTrigger(args) {
        if (initialized == 'true') {
            if (args.STATE == 'started/resumed') {
                gameplayState = 'started/resumed'
                return 'Work In Progress'
            } else if (args.STATE == 'stopped/paused') {
                gameplayState = 'stopped/paused'
                return 'Work In Progress'
            } else if (args.STATE == 'celebrated') {
                gameplayState = 'celebrated'
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    adBanner(args) {
        if (initialized == 'true') {
            if (args.BC == 'an ad banner') {
                adBanner == 'true'
                if (args.RES == '728x90') {
                    return 'Work In Progress'
                } else if (args.RES == '300x250') {
                    return 'Work In Progress'
                } else if (args.RES == '320x50') {
                    return 'Work In Progress'
                } else if (args.RES == '468x60') {
                    return 'Work In progress'
                } else if (args.RES = '320x100') {
                    return 'Work In Progress'
                } else {
                    return 'Error'
                }
            } else if (args.BC == 'a responsive banner container') {
                responsiveBannerContainer = 'true'
                if (args.RES == '970x90') {
                    return 'Work In Progress'
                } else if (args.RES == '320x50') {
                    return 'Work In Progress'
                } else if (args.RES == '160x600') {
                    return 'Work In Progress'
                } else if (args.RES == '336x280') {
                    return 'Work In Progress'
                } else if (args.RES == '728x90') {
                    return 'Work In Progress'
                } else if (args.RES == '300x600') {
                    return 'Work In Progress'
                } else if (args.RES == '468x60') {
                    return 'Work In Progress'
                } else if (args.RES == '970x250') {
                    return 'Work In Progress'
                } else if (args.RES == '300x250') {
                    return 'Work In Progress'
                } else if (args.RES == '250x250') {
                    return 'Work In Progress'
                } else if (args.RES == '120x600') {
                    return 'Work In Progress'
                } else {
                    return 'Error'
                }
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    bannerRemove(args) {
        if (initialized == 'true') {
            if (args.BC == 'an ad banner') {
                adBanner = 'false'
                return 'Work In Progress'
            } else if (args.BC == 'a responsive banner container') {
                responsiveBannerContainer = 'false'
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
    pageScroll(args) {
        if (initialized == 'true') {
            if (args.ACT == 'Enable') {
                pageScroll = 'true'
                return 'Work In Progress'
            } else if (args.ACT == 'Disable') {
                pageScroll = 'false'
                return 'Work In Progress'
            } else {
                return 'Error'
            }
        } if (initialized == 'false') {
            return 'Error. Not initialized'
        } else {
            return 'Error'
        }
    }
}
Scratch.extensions.register(new CGDTK());
